import React from "react";
import Icon from "Icon";

export default function Header() {
    const icons = Icon.map(icon => {
        return(
            <Icon
                key ={icon.id}
                {...icon}
            />
        )
    })
    return (
        <header>
            <div className="header-content">
                <img src={icons.id == 1}></img>
                <h2>my travel journal.</h2>
            </div>
        </header>
    )
}
